import React, { Component } from "react";
import "../App.css";
import { makeStyles } from "@material-ui/core/styles";
import GridList from "@material-ui/core/GridList";
import GridListTile from "@material-ui/core/GridListTile";
import GridListTileBar from "@material-ui/core/GridListTileBar";
import IconButton from "@material-ui/core/IconButton";
import FullscreenIcon from "@material-ui/icons/Fullscreen";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
    flexWrap: "wrap",
    justifyContent: "space-around",
    overflow: "hidden",
    backgroundColor: theme.palette.background.paper,
  },
  gridList: {
    width: 500,
    height: 450,
    // Promote the list into his own layer on Chrome. This cost memory but helps keeping high FPS.
    transform: "translateZ(0)",
  },
  titleBar: {
    background:
      "linear-gradient(to bottom, rgba(0,0,0,0.7) 0%, " +
      "rgba(0,0,0,0.3) 70%, rgba(0,0,0,0) 100%)",
  },
  icon: {
    color: "white",
  },
}));
const tileData = [
  { img: image1, title: "Image1", author: "author", featured: true },
  { img: image2, title: "Image2", author: "author", featured: true },
  { img: image3, title: "Image3", author: "author", featured: true },
  { img: image4, title: "Image4", author: "author", featured: true },
  { img: image5, title: "Image5", author: "author", featured: true },
];
export default function Images() {
  const classes = useStyles();
  return (
    <div class="block mb">
      <div class="mb">Images</div>
      <ul class="mdc-image-list myImageList">
        <li class="mdc-image-list__item">
          <div class="mdc-iamge-list__image-aspect-container">
            <img src="../resources/image1.jpg" class="mdc-image-list_image" />
          </div>
        </li>
        <li class="mdc-image-list__item">
          <div class="mdc-iamge-list__image-aspect-container">
            <img src="../resources/image2.png" class="mdc-image-list_image" />
          </div>
        </li>
        <li class="mdc-image-list__item">
          <div class="mdc-iamge-list__image-aspect-container">
            <img src="../resources/image3.jpg" class="mdc-image-list_image" />
          </div>
        </li>
        <li class="mdc-image-list__item">
          <div class="mdc-iamge-list__image-aspect-container">
            <img src="../resources/image4.jpg" class="mdc-image-list_image" />
          </div>
        </li>
      </ul>
    </div>
  );
}
